import React from 'react';

const AUTH_URL = "https://accounts.spotify.com/authorize?client_id=1a9068e5a02c4897adb142f295edfe75&response_type=code&redirect_uri=http://localhost:3000&scope=streaming%20user-read-email%20user-read-private%20user-library-read%20user-library-modify%20user-read-playback-state%20user-modify-playback-state"

const Login = () => {
    return (
        <div className="login">
            <a className="loginbtn"  href={AUTH_URL}>
                <span>Login with Spotify</span>
                </a>
        </div>
    );
};

export default Login;
